const convertToCelsius = function(tempC) {
    tempC - 32;
    tempC.toFixed(1)
    console.log(tempC)
};

const convertToFahrenheit = function(tempF) {
    tempF + 32;
    tempF.toFixed(1)
    console.log(tempF)
};

// Do not edit below this line
module.exports = {
  convertToCelsius,
  convertToFahrenheit
};